import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import ProductList from './components/ProductList';
import Cart from './components/Cart';
import UserProfile from './components/UserProfile';
import LoginModal from './components/LoginModal';
import RegisterModal from './components/RegisterModal';

function App() {
  const [isLoginModalOpen, setIsLoginModalOpen] = useState(false);
  const [isRegisterModalOpen, setIsRegisterModalOpen] = useState(false);

  return (
    <Router>
      <Header />
      <button onClick={() => setIsLoginModalOpen(true)}>Войти</button>
      <button onClick={() => setIsRegisterModalOpen(true)}>Регистрация</button>
      <LoginModal show={isLoginModalOpen} onClose={() => setIsLoginModalOpen(false)} />
      <RegisterModal show={isRegisterModalOpen} onClose={() => setIsRegisterModalOpen(false)} />
      <main>
        <Routes>
          <Route path="/" element={<ProductList />} />
          <Route path="/cart" element={<Cart />} />
          <Route path="/profile" element={<UserProfile />} />
        </Routes>
      </main>
      <Footer />
    </Router>
  );
}

export default App;
